import React from "react";
import PropTypes from "prop-types";

const styles = {
    li: {
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: ".5rem 1rem",
        border: "1px solid #ccc",
        borderRadius: "4px",
        marginBottom: ".5rem"
    },
    input: {
        marginRight: "1rem"
    }
}

function PortfolioItem({id, name, spotRate}){

    return (
       <span >
           {id}  &nbsp; {name}  &nbsp; {spotRate}
       </span>
    )
}

PortfolioItem.propTypes = {
    todo: PropTypes.object.isRequired,
}
export default PortfolioItem
